import React, { Fragment } from "react";
import {Doughnut, Bar} from 'react-chartjs-2'
import 'chart.js/auto';

const data = {
  labels: ['red', 'blue', 'green'],
  datasets: [{
    data: [12, 5, 6]
  }]
}


const BarChart = () => {
  return (
    <div>
   <Bar data={data}/>
 </div>
  )
}

const DoughnutChart = () => {
  return (
    <>
      <Doughnut data={data}/>
    </>
  )
}

export {
  BarChart
}
